//app.clickup.com/2454647/v/f/8790930/2494669",link:null,referent_info:"Julien COMPAGNON",referent_business:"Stéphanie LAUNOIS",developers:["Adrien RAOULT"],history:[{id:323,date:"27/01/2022 10:03",author:null,message:'Réunion point API Noémie, voir CR dans onglet documents "API Automate NOEMIE - COMPTE RENDU -27.01.2022"<br><br><div>- Création de mouvements pour les nouveaux bénéficiaires non cochés Noémie et pas en refus télétransmission: en cours</div><div><br></div><div>- Prévoir une remontée dans l’historique des non-actions de l’automate avec les anomalies: en cours</div><div><br></div><div>- Création des pages web de suivi des codes CPAM et/ou NIR invalides: à planifier</div><div><br></div><div>- Ajouter la règle spécifique de la dé-noémisation d’une adhérent lié à la MSA dans l’API et l’automate: à planifier</div><div><br></div><div>- Requêtes trop lourdes en production (dé-noémisation) doivent être lancées manuellement par Adrien: réglé en date du 26/01/2022</div><div><br></div>',project_id:144},{id:324,date:"01/02/2022 12:20",author:null,message:"Le prochain atelier a été planifié en date du Jeudi 3 février 2022 de 10h30 à 11h00.\nAtelier Teams\nParticipants : Julie OZIEBALA, Stéphanie LAUNOIS, Adrien RAOUT, Julien COMPAGNON\n",project_id:144},{id:325,date:"03/02/2022 10:30",author:null,message:"Atelier de travail avec Stéphanie LAUNOIS, Adrien RAOULT, Julien COMPAGNON\nVoir CR onglet documents\n",project_id:144},{id:326,date:"10/02/2022 10:30",author:null,message:"<div>Atelier de travail avec Julie OZIEBALA, Stéphanie LAUNOIS, Adrien RAOULT, Julien COMPAGNON - Voir CR onglet documents</div><div><br></div><div>Principale amélioration réalisée et à recetter:</div><div>Dans l’automate à ce jour, est visible toutes les actions, conduisant à une modification de Cafeteria, que mène l’automate. Il faut que l’on historise également toutes les actions que l’automate ne mène pas :</div><div>- Le but étant que la gestion gagne en autonomie</div><div>- De s’assurer que la totalité du périmètre NOEMIE soit couvert par l’automate</div><div>- De pouvoir visualiser les anomalies silencieuses, car aucun traitement réalisé ce jour</div>",project_id:144},{id:327,date:"10/02/2022 10:30",author:null,message:"Atelier de travail avec Julie OZIEBALA, Stéphanie LAUNOIS, Adrien RAOULT, Julien COMPAGNON - Voir CR onglet documents\nLe prochain atelier a été planifié en date du Jeudi 24 février 2022 de 10h30 à 11h00.\nParticipants : Julie OZIEBALA, Stéphanie LAUNOIS, Adrien RAOUT, Julien COMPAGNON",project_id:144},{id:342,date:"22/02/2022 16:40",author:null,message:"Julien en congés du 14/02/2022 au 18/02/2022 prochaine réunion le 24/02/2022",project_id:144},{id:346,date:"24/02/2022 10:30",author:null,message:"Atelier de travail avec Julie OZIEBALA, Stéphanie LAUNOIS, Adrien RAOULT, Julien COMPAGNON - Voir CR onglet documents.<br><div>Prochain atelier le Jeudi 3 mars 2022 de 10h30 à 11h00</div><div><br></div>En cours:<br>- Vérification de la validité des codes CPAM<br>- Améliorations sur le suivi des actions non réalisées par l'automate<br>- Création des pages de suivi:<br>&nbsp; &nbsp; * CPAM sans lien<div>&nbsp; &nbsp; * NIR incomplets<br>- Faire fonctionner le point d'accès depuis HERMES aux outils Noémie<br>- Gestion des cas de double rattachement, 1 parent sur la MSA, l’autre sur la CPAM</div>",project_id:144},{id:373,date:"03/03/2022 10:30",author:null,message:"Atelier de travail avec Julie OZIEBALA, Stéphanie LAUNOIS, Adrien RAOULT, Julien COMPAGNON - Voir CR onglet documents.<br>Prochain atelier le Jeudi 10 mars 2022 de 10h30 à 11h00<br><br>En cours:<br>- Vérification de la validité des codes CPAM<br>- Améliorations sur le suivi des actions non réalisées par l'automate<br>- Faire fonctionner le point d'accès depuis HERMES aux outils Noémie<br>- Gestion des cas de double rattachement, 1 parent sur la MSA, l’autre sur la CPAM<br><br>En production:<br>- Outil de suivi:<br>    * CPAM sans lien<br>    * NIR incomplets<br>   mis en production